import React from 'react';

function Home() {
  return (
    <div className="container mx-auto p-4">
      <h1 className="text-4xl font-bold text-purple-600 mb-4">Welcome to My Portfolio</h1>
      <p className="text-black mb-4">Hi, I'm John Doe. I'm a Web Developer based in New York City.</p>
      <img src="/placeholder-image.jpg" alt="John Doe" className="rounded-full w-64 h-64 object-cover" />
    </div>
  );
}

export default Home;
